import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on the Electronics category card
    await page.waitForSelector('div.category-card:has-text("Electronics")', { timeout: 5000 });
    await page.click('div.category-card:has-text("Electronics")');

    // Wait for category results to load
    await page.waitForSelector('.category-results', { timeout: 5000 });

    // Take screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_electronics_category.png'));

    // Extract category information
    const categoryTitle = await page.$eval('.category-results h2', el => el.textContent.trim());
    const resultsCount = await page.$eval('.results-count', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Electronics category",
      extractedData: {
        category: categoryTitle,
        resultsCount: resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Electronics category",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
